  \"2016-07-27T22:46:20.676900\",\n\t\"name\": \"hydrogeomorphic-evaluation-of-ecosystem-restoration-and-management-options-for-quivira-nat\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Evaluation of Ecosystem Restoration
  and Management Options covers the hydrogeomorphic analysis (HGM) for the Quivira
  National Wildlife Refuge (NWR). This three step process outlines the historical
  landscape, contemporary changes from pre-settlement conditions, restoration and
  management options and monitoring and evaluation needs within wetland and upland
  areas on the refuge. Topics include geomorphology, soils, topography/elevation,
  climate and hydrology. This report provides a hydrogeomorphic (HGM) evaluation of
  ecosystem restoration and management options for the Quivira National Wildlife Refuge
  (NWR). Objectives of the report are:1. Describe the pre-European settlement (hereafter
  Pre-settlement) ecosystem condition and ecological processes occurring near and
  including the salt marshes in Stafford County, Kansas. 2. Document changes in the
  regional ecosystem from the Pre-settlement period with specific reference to alterations
  in hydrology, vegetation community structure and distribution, and resource availability
  to key fish and wildlife species.3. Identify restoration and management options
  incorporating ecological attributes needed to restore specific habitats and conditions
  within Quivira NWR.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
